const DUMMY_EVENTS = [
  {
    id: "e1",
    title: "Some event",
  },
  {
    id: "e2",
    title: "Another event",
  },
];

function EventsPage() {
  return <>
  <h1>Event Page</h1>
  <ul>
 { DUMMY_EVENTS.map((item) => (
    <li key={item.id}></li>
  ))}
  </ul></>;
}

export default EventsPage;
